measurements.description:
An attractive 17-ft x 5-ft rectangular, multi-tiered table and floor display with background lighting along the entire length;
 accents for Masquerade theme interspersed with many specimen-sized plants of a wide variety of genera;
 color flowed from cool to neutral to warm, left to right;
 flowers from over 70 plants including Dendrobium, Cattleya, Cymbidium, Paphiopedilum; Miltonia, and Leptotes;
  also received the Show Trophy, #20225414.
